import React from "react";

export const TakeSurvey=(props)=>{

  return(
    <>
    {
      props.qbank.map((ele)=>{
        <h2>{ele.question}</h2>
        ele.options.map((opt)=>{
        <p>{opt.value}</p>
        })
      })
    }
    </>
  )
}
